// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/token/common/ERC2981.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/utils/cryptography/ECDSA.sol";
import "@openzeppelin/contracts/utils/cryptography/EIP712.sol";
import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol"; // Added for Merkle proof verification

contract LaunchNFTV2 is
  ERC721,
  ERC721URIStorage,
  ERC2981,
  Ownable,
  ERC721Enumerable,
  EIP712
{
  using ECDSA for bytes32;

  enum PhaseType {
    NOT_STARTED,
    WHITELIST,
    PUBLIC
  }

  struct Phase {
    PhaseType phaseType;
    uint256 price;
    uint256 startTime;
    uint256 endTime;
    uint256 maxSupply;
    uint256 maxPerWallet; // Can be 0 for unlimited in PUBLIC phase
    uint256 maxMintPerPhase; // Can be 0 for unlimited in PUBLIC phase
    uint256 mintedInPhase; // Track mints in current phase
    bytes32 merkleRoot;
  }

  // Signature verification related
  address public immutable backendSigner;

  // Modified MINT_TYPEHASH to include phase information
  bytes32 private constant MINT_TYPEHASH =
    keccak256(
      "MintRequest(address minter,uint256 tokenId,string uri,uint256 price,uint256 phaseIndex,uint256 nonce,uint256 deadline)"
    );

  mapping(address => uint256) private nonces;

  // Multi-phase configuration
  Phase[] public phases;
  mapping(address => mapping(PhaseType => uint256))
    private mintedPerWalletInPhase;

  // Fee-related state variables
  uint96 private immutable royaltyFeePercentage;
  uint96 public platformFeePercentage;
  address public platformFeeRecipient;

  // Events
  event TokenMinted(
    uint256 indexed tokenId,
    address indexed recipient,
    PhaseType phaseType
  );
  event PhaseAdded(
    uint256 indexed phaseIndex,
    PhaseType phaseType,
    uint256 price,
    uint256 startTime,
    uint256 endTime,
    uint256 maxSupply,
    uint256 maxPerWallet,
    uint256 maxMintPerPhase,
    bytes32 merkleRoot
  );
  event PhaseUpdated(
    uint256 indexed phaseIndex,
    PhaseType phaseType,
    uint256 price,
    uint256 startTime,
    uint256 endTime,
    uint256 maxSupply,
    uint256 maxPerWallet,
    uint256 maxMintPerPhase,
    bytes32 merkleRoot
  );
  event PlatformFeeUpdated(uint96 newPercentage, address newRecipient);
  event WithdrawCompleted(address indexed recipient, uint256 amount);

  error PhaseNotActive();
  error InvalidSignature();
  error SignatureExpired();
  error InvalidMerkleProof();
  error ExceedsPhaseSupply();
  error ExceedsWalletLimit();
  error InsufficientPayment();
  error PriceMismatch();
  error TransferFailed();
  error InvalidPhaseIndex();
  error InvalidPhaseConfiguration();
  error OverlappingPhases();
  error NoActivePhase();

  constructor(
    address initialOwner,
    string memory name,
    string memory symbol,
    uint96 _royaltyFee,
    uint96 _platformFee,
    address _platformFeeRecipient,
    address _backendSigner
  ) ERC721(name, symbol) Ownable(initialOwner) EIP712("UnifiedNFT", "1") {
    require(_royaltyFee <= 1000, "Royalty fee cannot exceed 10%");
    require(_platformFee <= 1000, "Platform fee cannot exceed 10%");
    require(
      _platformFeeRecipient != address(0),
      "Invalid platform fee recipient"
    );
    require(_backendSigner != address(0), "Invalid backend signer");

    backendSigner = _backendSigner;
    royaltyFeePercentage = _royaltyFee;
    platformFeePercentage = _platformFee;
    platformFeeRecipient = _platformFeeRecipient;

    _setDefaultRoyalty(initialOwner, royaltyFeePercentage);

    // Initialize with NOT_STARTED phase
    phases.push(
      Phase({
        phaseType: PhaseType.NOT_STARTED,
        price: 0,
        startTime: 0,
        endTime: 0,
        maxSupply: 0,
        maxPerWallet: 0,
        maxMintPerPhase: 0,
        mintedInPhase: 0,
        merkleRoot: bytes32(0)
      })
    );
  }

  function mint(
    uint256 tokenId,
    string calldata uri,
    uint256 deadline,
    bytes calldata signature,
    bytes32[] calldata merkleProof // Added merkle proof parameter
  ) external payable {
    // Get current active phase and index
    (uint256 phaseIndex, Phase storage currentPhase) = _getActivePhase();

    // FIXED: Verify merkle proof for whitelist phase
    if (currentPhase.phaseType == PhaseType.WHITELIST) {
      bytes32 leaf = keccak256(abi.encodePacked(msg.sender));
      if (!MerkleProof.verify(merkleProof, currentPhase.merkleRoot, leaf)) {
        revert InvalidMerkleProof();
      }
    }

    // Verify signature
    if (deadline < block.timestamp) revert SignatureExpired();

    // FIXED: Include phaseIndex in the signature to tie it to a specific phase
    bytes32 structHash = keccak256(
      abi.encode(
        MINT_TYPEHASH,
        msg.sender,
        tokenId,
        keccak256(bytes(uri)),
        currentPhase.price, // FIXED: Ensure signed price matches current phase price
        phaseIndex, // FIXED: Include phase index in signature
        nonces[msg.sender]++,
        deadline
      )
    );

    bytes32 hash = _hashTypedDataV4(structHash);
    if (hash.recover(signature) != backendSigner) revert InvalidSignature();

    // FIXED: Ensure paid amount matches phase price
    if (msg.value != currentPhase.price) revert PriceMismatch();

    // FIXED: Check phase-specific supply limit instead of global limit
    if (
      currentPhase.maxSupply != 0 &&
      currentPhase.mintedInPhase >= currentPhase.maxSupply
    ) {
      revert ExceedsPhaseSupply();
    }

    // Check wallet limits (skip if unlimited in PUBLIC phase)
    if (
      !(currentPhase.phaseType == PhaseType.PUBLIC &&
        currentPhase.maxPerWallet == 0) &&
      mintedPerWalletInPhase[msg.sender][currentPhase.phaseType] >=
      currentPhase.maxPerWallet
    ) {
      revert ExceedsWalletLimit();
    }

    // FIXED: Handle maxMintPerPhase correctly (0 for PUBLIC phase means unlimited)
    if (
      !(currentPhase.phaseType == PhaseType.PUBLIC &&
        currentPhase.maxMintPerPhase == 0) &&
      currentPhase.mintedInPhase >= currentPhase.maxMintPerPhase
    ) {
      revert ExceedsPhaseSupply();
    }

    // Process fees
    uint256 platformFeeAmount = (msg.value * platformFeePercentage) / 10000;

    if (platformFeeAmount > 0) {
      (bool success, ) = platformFeeRecipient.call{value: platformFeeAmount}(
        ""
      );
      if (!success) revert TransferFailed();
    }

    uint256 remainingAmount = msg.value - platformFeeAmount;
    if (remainingAmount > 0) {
      (bool success, ) = owner().call{value: remainingAmount}("");
      if (!success) revert TransferFailed();
    }

    // Update phase minting stats
    currentPhase.mintedInPhase++;
    mintedPerWalletInPhase[msg.sender][currentPhase.phaseType]++;

    // Mint token
    _safeMint(msg.sender, tokenId);
    if (bytes(uri).length > 0) {
      _setTokenURI(tokenId, uri);
    }

    emit TokenMinted(tokenId, msg.sender, currentPhase.phaseType);
  }

  function _getActivePhase()
    internal
    view
    returns (uint256 phaseIndex, Phase storage phase)
  {
    uint256 timestamp = block.timestamp;

    for (uint256 i = 0; i < phases.length; i++) {
      if (
        phases[i].phaseType != PhaseType.NOT_STARTED &&
        timestamp >= phases[i].startTime &&
        timestamp <= phases[i].endTime
      ) {
        return (i, phases[i]);
      }
    }

    revert NoActivePhase();
  }

  function getActivePhase()
    external
    view
    returns (uint256 phaseIndex, Phase memory phase)
  {
    return _getActivePhase();
  }

  function addPhase(
    PhaseType _phaseType,
    uint256 _price,
    uint256 _startTime,
    uint256 _endTime,
    uint256 _maxSupply,
    uint256 _maxPerWallet,
    uint256 _maxMintPerPhase,
    bytes32 _merkleRoot
  ) external onlyOwner {
    require(_startTime < _endTime, "Invalid time range");

    // FIXED: Allow maxPerWallet = 0 for PUBLIC phase to enable unlimited mints
    if (_phaseType == PhaseType.PUBLIC) {
      // For public phases, allow unlimited per wallet and unlimited supply
    } else {
      require(_maxPerWallet > 0, "Invalid max per wallet for non-public phase");
      require(
        _maxMintPerPhase > 0,
        "Invalid max mint per phase for non-public phase"
      );
      require(
        _merkleRoot != bytes32(0),
        "Merkle root required for whitelist phase"
      );
    }

    // Ensure no overlapping phases
    for (uint256 i = 0; i < phases.length; i++) {
      Phase memory existingPhase = phases[i];
      if (existingPhase.phaseType == PhaseType.NOT_STARTED) continue;

      // Check for time overlap
      if (
        (_startTime <= existingPhase.endTime &&
          _endTime >= existingPhase.startTime)
      ) {
        revert OverlappingPhases();
      }
    }

    Phase memory newPhase = Phase({
      phaseType: _phaseType,
      price: _price,
      startTime: _startTime,
      endTime: _endTime,
      maxSupply: _maxSupply,
      maxPerWallet: _maxPerWallet,
      maxMintPerPhase: _maxMintPerPhase,
      mintedInPhase: 0,
      merkleRoot: _merkleRoot
    });

    uint256 phaseIndex = phases.length;
    phases.push(newPhase);

    emit PhaseAdded(
      phaseIndex,
      _phaseType,
      _price,
      _startTime,
      _endTime,
      _maxSupply,
      _maxPerWallet,
      _maxMintPerPhase,
      _merkleRoot
    );
  }

  function updatePhase(
    uint256 _phaseIndex,
    PhaseType _phaseType,
    uint256 _price,
    uint256 _startTime,
    uint256 _endTime,
    uint256 _maxSupply,
    uint256 _maxPerWallet,
    uint256 _maxMintPerPhase,
    bytes32 _merkleRoot
  ) external onlyOwner {
    if (_phaseIndex >= phases.length) revert InvalidPhaseIndex();
    if (_startTime >= _endTime) revert InvalidPhaseConfiguration();

    // FIXED: Allow maxPerWallet = 0 for PUBLIC phase
    if (_phaseType == PhaseType.PUBLIC) {
      // For public phases, allow unlimited per wallet and unlimited supply
    } else {
      if (_maxPerWallet == 0) revert InvalidPhaseConfiguration();
      if (_maxMintPerPhase == 0) revert InvalidPhaseConfiguration();
      if (_merkleRoot == bytes32(0)) revert InvalidPhaseConfiguration();
    }

    // Ensure no overlapping phases
    for (uint256 i = 0; i < phases.length; i++) {
      if (i == _phaseIndex) continue; // Skip the phase being updated
      Phase memory existingPhase = phases[i];
      if (existingPhase.phaseType == PhaseType.NOT_STARTED) continue;

      // Check for time overlap
      if (
        (_startTime <= existingPhase.endTime &&
          _endTime >= existingPhase.startTime)
      ) {
        revert OverlappingPhases();
      }
    }

    Phase storage phaseToUpdate = phases[_phaseIndex];
    phaseToUpdate.phaseType = _phaseType;
    phaseToUpdate.price = _price;
    phaseToUpdate.startTime = _startTime;
    phaseToUpdate.endTime = _endTime;
    phaseToUpdate.maxSupply = _maxSupply;
    phaseToUpdate.maxPerWallet = _maxPerWallet;
    phaseToUpdate.maxMintPerPhase = _maxMintPerPhase;
    phaseToUpdate.merkleRoot = _merkleRoot;

    // FIXED: Use correct event for phase updates
    emit PhaseUpdated(
      _phaseIndex,
      _phaseType,
      _price,
      _startTime,
      _endTime,
      _maxSupply,
      _maxPerWallet,
      _maxMintPerPhase,
      _merkleRoot
    );
  }

  function setPlatformFee(
    uint96 _feePercentage,
    address _feeRecipient
  ) external onlyOwner {
    require(_feePercentage <= 1000, "Platform fee cannot exceed 10%");
    require(_feeRecipient != address(0), "Invalid fee recipient");

    platformFeePercentage = _feePercentage;
    platformFeeRecipient = _feeRecipient;

    emit PlatformFeeUpdated(_feePercentage, _feeRecipient);
  }

  // FIXED: Added withdraw function to recover accidentally sent ETH
  function withdraw() external onlyOwner {
    uint256 balance = address(this).balance;
    require(balance > 0, "No balance to withdraw");

    (bool success, ) = owner().call{value: balance}("");
    if (!success) revert TransferFailed();

    emit WithdrawCompleted(owner(), balance);
  }

  // Required overrides
  function supportsInterface(
    bytes4 interfaceId
  )
    public
    view
    override(ERC721, ERC721URIStorage, ERC2981, ERC721Enumerable)
    returns (bool)
  {
    return super.supportsInterface(interfaceId);
  }

  function tokenURI(
    uint256 tokenId
  ) public view override(ERC721, ERC721URIStorage) returns (string memory) {
    return super.tokenURI(tokenId);
  }

  function _update(
    address to,
    uint256 tokenId,
    address auth
  ) internal override(ERC721, ERC721Enumerable) returns (address) {
    return super._update(to, tokenId, auth);
  }

  function _increaseBalance(
    address account,
    uint128 value
  ) internal override(ERC721, ERC721Enumerable) {
    super._increaseBalance(account, value);
  }

  // View functions
  function getDomainSeparator() external view returns (bytes32) {
    return _domainSeparatorV4();
  }

  function getNonce(address user) external view returns (uint256) {
    return nonces[user];
  }

  function getMintedInPhase(
    address user,
    PhaseType phaseType
  ) external view returns (uint256) {
    return mintedPerWalletInPhase[user][phaseType];
  }

  function getPhaseCount() external view returns (uint256) {
    return phases.length;
  }

  function isActivePhasePresent() public view returns (bool) {
    uint256 timestamp = block.timestamp;

    for (uint256 i = 0; i < phases.length; i++) {
      if (
        phases[i].phaseType != PhaseType.NOT_STARTED &&
        timestamp >= phases[i].startTime &&
        timestamp <= phases[i].endTime
      ) {
        return true;
      }
    }

    return false;
  }
}

